measurements.description:
Approximately 1,400 flowers on nine inflorescences, gracefully arranged cylindrically on three pseudobulbs, borne on a mounted plant, front pseudobulb
	having six inflorescences, middle pseudobulb two inflorescences, back pseudobulb one inflorescence, foliage pristine; 
	sepals and petals ivory suffused dark pink, white apically; lip maroon, white on distal half;  column maroon, anther cap yellow;
    substance firm; texture crystalline; awarded for pristine foliage and graceful compact inflorescences.
